/// To build a server, implement a class that conforms to this protocol.
public protocol Flipchat_Chat_V1_ChatProvider: CallHandlerProvider {
  var interceptors: Flipchat_Chat_V1_ChatServerInterceptorFactoryProtocol? { get }

  /// StreamChatEvents streams all chat events for the requesting user.
  ///
  /// Chat events will include any update to a chat, including:
  ///   1. Metadata changes.
  ///   2. Membership changes.
  ///   3. Latest messages.
  ///
  /// The server will optionally filter out some events depending on load
  /// and chat type. For example, Broadcast chats may not receive latest
  /// messages.
  ///
  /// Clients should use GetMessages to backfill in any historical messages
  /// for a chat. It should be sufficient to rely on ChatEvents for some types
  /// of chats, but using StreamMessages provides a guarentee of message events
  /// for all chats.
  func streamChatEvents(context: StreamingResponseCallContext<Flipchat_Chat_V1_StreamChatEventsResponse>) -> EventLoopFuture<(StreamEvent<Flipchat_Chat_V1_StreamChatEventsRequest>) -> Void>

  /// GetChats gets the set of chats for an owner account using a paged API.
  /// This RPC is aware of all identities tied to the owner account.
  func getChats(request: Flipchat_Chat_V1_GetChatsRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_GetChatsResponse>

  /// GetChat returns the metadata for a specific chat.
  func getChat(request: Flipchat_Chat_V1_GetChatRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_GetChatResponse>

  /// StartChat starts a chat. The RPC call is idempotent and will use existing
  /// chats whenever applicable within the context of message routing.
  func startChat(request: Flipchat_Chat_V1_StartChatRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_StartChatResponse>

  /// JoinChat joins a given chat.
  func joinChat(request: Flipchat_Chat_V1_JoinChatRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_JoinChatResponse>

  /// LeaveChat leaves a given chat.
  func leaveChat(request: Flipchat_Chat_V1_LeaveChatRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_LeaveChatResponse>

  /// SetDisplayName sets a chat's display name. If the display name isn't allowed,
  /// then a set of alternate suggestions may be provided
  func setDisplayName(request: Flipchat_Chat_V1_SetDisplayNameRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_SetDisplayNameResponse>

  /// SetCoverCharge sets a chat's cover charge
  func setCoverCharge(request: Flipchat_Chat_V1_SetCoverChargeRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_SetCoverChargeResponse>

  /// GetMemberUpdates gets member updates for a given chat
  func getMemberUpdates(request: Flipchat_Chat_V1_GetMemberUpdatesRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_GetMemberUpdatesResponse>

  /// RemoveUser removes a user from a chat
  func removeUser(request: Flipchat_Chat_V1_RemoveUserRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_RemoveUserResponse>

  /// MuteUser mutes a user in the chat and removes their ability to send messages
  func muteUser(request: Flipchat_Chat_V1_MuteUserRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_MuteUserResponse>

  /// MuteChat mutes a chat and disables push notifications
  func muteChat(request: Flipchat_Chat_V1_MuteChatRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_MuteChatResponse>

  /// UnmuteChat unmutes a chat and enables push notifications
  func unmuteChat(request: Flipchat_Chat_V1_UnmuteChatRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_UnmuteChatResponse>

  /// ReportUser reports a user for a given message
  ///
  /// todo: might belong in a different service long-term
  func reportUser(request: Flipchat_Chat_V1_ReportUserRequest, context: StatusOnlyCallContext) -> EventLoopFuture<Flipchat_Chat_V1_ReportUserResponse>
}

